package starpaterns2;

public class Pattern26 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		char c='E';
		
		for(char ch='A';ch<=c;ch++)
		{
			for(char a='A';a<=c;a++ )
			{
				System.out.print(ch+" ");
			}
			System.out.println();
		}

	}

}
